import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import ListUserComponent from './components/ListUserComponent';
import HeaderComponent from './components/HeaderComponent';
import FooterComponent from './components/FooterComponent';
import CreateUserComponent from './components/CreateUserComponent';
import ViewUserComponent from './components/ViewUserComponent';
import UpdateUserComponent from './components/UpdateUserComponent';
import ViewTaskComponent from './components/ViewTaskComponent';
import LoginPage from './components/LoginPage';
import RegistrationPage from './components/RegistrationPage';

function App() {
  return (
    <div>
      <Router>
        <HeaderComponent />
        <div style={{ backgroundColor: '#9b59b6' }}>
          <div className="container">
            <Routes>
              <Route path="/" Component={LoginPage} />
              <Route path="/register" Component={RegistrationPage}/>
              <Route path="/home" Component={ViewUserComponent}/>
              <Route path="/add-list" Component={CreateUserComponent}/>
              <Route path="/list/all" Component={ListUserComponent}/>
              <Route path="/update/:id" Component={UpdateUserComponent}/>
              <Route path="/viewTask" Component={ViewTaskComponent} />
            </Routes>
          </div>
        </div>
        <FooterComponent />
      </Router>
    </div>
  );
}

export default App;
